import React, { memo } from 'react';
import styled from 'styled-components';
import logo from '../assets/img/logo/logo.png';
import plus from '../assets/img/icon/plus-icon.png';

const Header = styled.div`
    width: 960px;
    height: 120px;
    margin: 0 auto;
    background-color: red;
    .first-line{
        width: 95%;
        height: 50px;
        margin: auto;

        .icon{
            display: flex;
            flex-direction: row;
            justify-content: space-evenly;
            .logo,
            .plus{
                width: 40px;
                height: 40px;
                margin-top: 10px;
            }
        }
    }
`;

const header = memo(() => {
    return (
        <Header>
            <div className='first-line'>
                <div className='icon'>
                    <img className='logo' src={logo} alt="mainLogo" />
                    <p>Easy KIOSK</p>
                    <img className='plus' src={plus} alt="plusIcon"/>
                </div>
            </div>
        </Header>
    );
});

export default header;
